import pandas as pd

user_reviews_df = pd.read_csv(PATH_TO_USER_REVIEWS) 
movie_genres_df = pd.read_csv(PATH_TO_MOVIE_GENRES)

"""##Content-based recommender system
Since the genres of the movies already has been specified in this dataset, a feature vector $x^{(i)}$ for each movie *i* exists and we can use concent-based recommendation system to try to predict each user *j*'s preferences $\theta^{j}$ and later use this to optimize over for e.g LMSE to learn  $\theta^{j}$  and use that to recommend movies to our users.

To improve computational efficiency, only a subset of 5 reviews is used during the implementating and testing of the algorithm. As we are using Content Based Reccomendations we only need the reviews for users that we supply recommendations to.

"""

user_reviews = user_reviews_df[:]
user_thetas = []

"""### helper functions"""

def get_seen_movies_ratings(user):
  seen_movies = user_reviews.iloc[user]
  seen_movies = seen_movies.drop(["Unnamed: 0", "User"])
  seen_movies = seen_movies[seen_movies!=0]
  
  return seen_movies

def get_features_for_movie(movie_title):
  return movie_genres_df.loc[movie_genres_df['movie_title'] == movie_title].drop(["movie_title", "Unnamed: 0"], axis=1).to_numpy()

import numpy as np

def get_user_theta(row):
  # for this particular row, delete all non-reviewed columns
  seen_movies = row[row!=0]

  # get array of ratings
  ratings = seen_movies.to_numpy().flatten()

  ## get array of all movies seen
  all_seen_movies = seen_movies.keys()

  ## keep track of the total rating a genre has been given by a user
  total_rating = np.zeros(25)
  ## initialize arrays to keep track of the number of times a genre has been rated by a user
  times_rated = np.zeros(25)

  for rating, movie_title in zip(ratings,all_seen_movies):
    # only keep numerical values, which features that each movie have
    array_features = get_features_for_movie(movie_title)

    # multiply the rating for the movie with each feature
    rating_per_feature = rating * array_features

    # increment the times a feature has been rated
    times_rated = times_rated + array_features
    # add the rating of the current features to the total rating of features
    total_rating = total_rating + rating_per_feature

  with np.errstate(divide='ignore',invalid='ignore'):
    theta = np.nan_to_num(np.divide(total_rating,times_rated))
    return np.array(theta)

def predict(features,theta):
    score = (features * theta).flatten()
    score = score[score!=0]
    return np.mean(score) if len(score) else 0

"""### Good ol' regular Content Based Recommendations baseline"""

good_movies = []

for index, row in user_reviews[:6].iterrows():
  
  user = row["User"]

  row = row.drop(["User", "Unnamed: 0"])
  
  # get theta for user
  user_theta = get_user_theta(row)
  user_thetas.append(user_theta)
  # all unseen movies
  unseen_movies = row[row==0].keys()
  movie_scores = []

  for movie_title in unseen_movies:
    features = get_features_for_movie(movie_title)

    prediction = predict(features, user_theta)

    movie_scores.append((movie_title, prediction))
  
  movie_scores.sort(key=lambda tup: tup[1])

  print("For user: ", user, ". Watch the movies:", movie_scores[-6:][::-1])

"""### Gradient descent"""

# for each user
for index, _row in user_reviews.iterrows():
  row = _row
  # get starting theta
  theta = user_thetas[index]
  # get user
  user = row["User"]

  # drop everything except genres
  row = row.drop(["User", "Unnamed: 0"])

  # get series of seen and unseen movies
  seen_movies = row[row!=0]
  unseen_movies = row[row==0]

  # stuff needed for gradient descent
  m = len(seen_movies)
  learning_rate=0.1

  # stores tuples (movie,prediction)
  movie_predictions = []
  
  # for each seen movie
  for movie_title, rating in seen_movies.iteritems():
      _features = get_features_for_movie(movie_title)

      ## iterate to improve theta (gradient descent)
      for it in range(100):
          _prediction = predict(_features,theta)
          theta = theta - (1/m)*(learning_rate) * (_prediction-rating)

  # for each unseen movie
  for movie_title in unseen_movies.keys():
      features = get_features_for_movie(movie_title)
      prediction = predict(features,theta)
      prediction = float("{:.2f}".format(prediction))
      movie_predictions.append((movie_title,prediction))


  movie_predictions.sort(key=lambda tup: tup[1])

  print("For user: ", user, ". Watch the movies:", movie_predictions[-6:][::-1])

