index_to_movie = movie_genres_df["movie_title"]
temp = index_to_movie.to_dict()
movie_to_index = dict((v, int(k)) for k, v in temp.items())

movie_to_index["The Net"]

movies = movie_genres_df["movie_title"].values
users = np.arange(len(user_reviews))
X = [np.random.uniform(0,1,25) for _ in movies]
theta = [np.random.uniform(0,5,25) for _ in users]
## learning rate
a = 0.0001
lmbda = 0.05

for it in range(10):
  for user_id in users:

    seen_movies = get_seen_movies_ratings(user_id)
    movie_titles = np.array(seen_movies.keys())
    ratings = seen_movies.values
  
    movies_X = np.array([X[movie_to_index[movie_title]] for movie_title in movie_titles])

    user_theta = theta[user_id]
    theta_change = 0

    
    for (movie_X, movie_title, rating) in zip(movies_X,movie_titles, ratings):
      movie_index = movie_to_index[movie_title]

      theta_change += (((user_theta * movie_X) - rating)) * user_theta + lmbda*movie_X

      X[movie_index] = movie_X - a * (((user_theta * movie_X) - rating) * movie_X + lmbda*user_theta)
    

    theta[user_id] = theta[user_id] - a * theta_change

for user in range(0,6):
  scores = np.zeros_like(movies)
  my_theta = theta[user]

  for idx,movie_title in enumerate(movies):
    predict_score = my_theta @ X[idx]
    scores[idx] = predict_score

  tuples = list(zip(movies,scores))
  tuples.sort(key=lambda tup: tup[1])

  print(user, tuples[::-1][:5])

def normalize_array(arr, norm=5):
  arr = np.array(arr)
  smallest = min(arr)
  largest = max(arr) + abs(smallest)

  arr = arr + abs(smallest)
  arr = arr / largest

  arr = arr * 5

  return arr